      newAccountDatabase.rawData.forEach((key, value) {
        new_account_database_isar[key] = value;
      });
      isar_core.write((isar) {
        isar.accountDatabases.put(new_account_database_isar);
      });
      return true;
    }

    newAccountDatabase.rawData.forEach((key, value) {
      result[key] = value;
    });
    isar_core.write((isar) {
      isar.accountDatabases.put(result);
    });
    return true;
  }

